import React, { Component } from 'react';
import NavBar from '../components/NavBar';
import 'bulma/css/bulma.css';
import WebFont from 'webfontloader'

WebFont.load({
    google: {
        families: ['Open Sans Condensed']
    }
});

const styles = {
    background: {
        position: 'absolute',
        justifyContent: 'center',
        zIndex: '-1'
    },
    title: {
        fontFamily: 'Open Sans Condensed',
        fontSize: '50px',
        fontWeight: '500',
        position: 'absolute',
        color: 'white',
        marginLeft: '15%',
        marginTop: '-4%'
        },
    title2: {
        fontFamily: 'Open Sans Condensed',
        fontSize: '50px',
        fontWeight: '500',
        position: 'relative',
        color: 'white',
        marginLeft: '15%',
        marginTop: '35%'
    },
    slogan: {
        fontFamily: 'Open Sans Condensed',
        fontSize: '17px',
        fontStyle: 'italic',
        position: 'relative',
        color: 'white',
        marginLeft: '18%',
        top: '5%'
    }
}

class HomePage extends Component {
    render() {
        return (
        <React.Fragment>
            <div><NavBar/></div>
            <img src={ process.env.PUBLIC_URL + '/main-background2.jpg'} style={ styles.background }/>
            <div className="container">
                <div style={ styles.title }>Ditch all the</div>
                <div style={ styles.title2 }>excel spreadsheets</div>
            </div>
            <div style= {styles.slogan }>Keep track of your job applications where it's meant to</div>
        </React.Fragment>
        );
    }
}

export default HomePage;
